import React from 'react'
import PostCard from './PostCard'

const PostsCards = ({posts}) => {
  return (
    <div>
       {/* POSTCARDS COMPONENT */}
       <div className="py-12 px-20">
        <div className=" grid grid-cols-1 sm:grid-cols-2 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-4 content-center text-center">
          {posts.map((post) => (
            <PostCard post={post}/>
          ))}
        </div>
      </div>
    </div>
  )
}

export default PostsCards
